import React from "react";
import './index.css'
function Card(props) {
    return (
        <div>
            <h2>{props.name}</h2>
            <img src={props.img} alt="Avatar_img"></img>
            <p>{props.phone}</p>
            <p>{props.email}</p>
        </div>
    )
}
export default Card;
